import styled from 'styled-components';
import Header from './Header';
import Footer from './Footer';

const Layout = styled.div`
  width: 100vw;
  height: 100vh;
  background: #ffeff7;

  display: grid;
  grid-template-rows: 250px 1fr 200px;
  grid-template-columns: 1fr;
`;

const Home = () => {
  return (
    <Layout>
      <Header />
      <h1>Welcome home</h1>
      <Footer />
    </Layout>
  );
};

export default Home;
